INSERT INTO `config_info` VALUES (49, 'zy-gateway-local.yaml', 'DEFAULT_GROUP', '# Tomcat\nserver:\n  port: 20238\n# Spring配置\nspring:\n  cloud:\n    gateway:\n      # globalcors:\n      #   cors-configurations:\n      #     \'[/**]\':\n      #       allowedHeaders: \"*\"\n      #       allowedOrigins: \'*\'\n      #       allowedMethods: \'*\'\n      #       maxAge: 3600\n      routes:\n        # zy-base项目\n        - id: zy-base             # 路由id\n          uri: lb://zy-base       # 动态路由\n          predicates:\n            - Path=/base/**       # 路径匹配才能请求路由地址\n          filters:\n            - StripPrefix=1       # 去除一个前缀（即第一个斜杠后的内容）\n        # zy-produce项目\n        - id: zy-produce\n          uri: lb://zy-produce\n          predicates:\n            - Path=/produce/**\n          filters:\n            - StripPrefix=1\n        # zy-monitor项目\n        - id: zy-monitor\n          uri: lb://zy-monitor\n          predicates:\n            - Path=/monitor/**\n          filters:\n            - StripPrefix=1\n            # - RewritePath=/monitor/applications/*,/applications/*', '97696895241ad46fc05449e8a0884172', '2023-08-26 06:38:34', '2023-09-15 07:14:59', NULL, '188.188.3.220', 'zy-gateway', '', '', '', '', 'yaml', '', '');
